import React from "react";
import "./Transaction.css";

function Transaction({type, description, date, category, id}) {

    return (
        <div id={id}
            className={`Transaction ${type === "income" ? "income-txn" : "expense-txn"}`}
        >
            <p>{type.title()}</p>
            <p>{description}</p>
            <p>{date}</p>
            <p>{category}</p>
        </div>
    );
};

export default Transaction;
